  {id:1, charge:"rent",amount:1600},
  {id:2, charge:"car payment",amount:400},
  {id:3, charge:"credit card bill",amount:1200}
];
console.log(initialExpenses);

function App() {
  return <>
  <Alert />
  <ExpenseForm />
  <ExpenseList />
  </>

}

export default App;
